import Head from 'next/head'
import styles from '../styles/Home.module.css'

const data = {
  sheds : [
    {
      id:'reynolds-example',
      deck:{
        floor:'advantech',
        width:96,
        length:144,
        insulate: false
      },
      walls:{
        width:96,
        length:144,
        stud:{
          height:72
        },
        insulate: false,
        electrical: false,
        layout:{
          a:[
            {type:'window', typeid:1, offset:0, order:1},
            {type:'door', typeid:1, offset:0, order:2},
            {type:'window', typeid:1, offset:0, order:3}
          ]
        }
      },
      roof: {
        type:'gable',
        insulate:false
      },
      siding: {
        type:'vinyl',
        color:'white'
      },
      roof:{
        type: 'shingle',
        color: 'black',
        vent: 'gable'
      },
      windows:[
        {id:1,type: 'standard', width:18, height:27, top:72.5, trim: false, box:false, shutters: false},
        {id:2, type: 'standard', width:18, height:27, top:72.5, trim: false, box:false, shutters: false}
      ],

      doors:[
        { id:1, type:'vinyl', width: 61.75, height:72.5, ramp:{width:52, length:60}}
      ],

      extras:[
        {type:'loft', width:36, length: 96 }
        ]

    }
  ]
}

const FloorPlan = (props) => (
  <svg height={props.walls.width} width={props.walls.length} viewBox="0 0 384 384">
    <rect x="0" y="0" height={props.walls.width} width={props.walls.length} stroke="black" fill="transparent" stroke-width="5"/>
  </svg>
);

export default function Shed() {
  return (
    <div className={styles.container}>
      <Head>
        <title>Shed Assistant</title>
        <link rel="icon" href="/favicon.ico" />
      </Head>

      <main className={styles.main}>
        <h1 className={styles.title}>
          Shed Assistant
        </h1>

        <p className={styles.description}>
          Work Orders
        </p>

        <div className={styles.grid}>

          {
            data.sheds.map(function(shed){
              return (          
              <a href="https://nextjs.org/learn" className={styles.card}>
                <h3>{shed.id}</h3>
                <p>{shed.walls.width/12}' x {shed.walls.length/12}'</p>

                <FloorPlan {...shed}/>

              </a>
          )
            })
          }



        </div>
      </main>

      <footer className={styles.footer}>
        Created by Stephen Reynolds, Jr.
      </footer>
    </div>
  )
}
